import {
  TableContainer,
  TableBody,
  TableCell,
  TableRow,
  Paper,
} from '@mui/material';
import { useEffect } from 'react';

export const Main = () => {
  return (
    <TableContainer component={Paper}>
      <TableBody>
        <TableRow>
          <TableCell />
          <TableCell />
          <TableCell />
        </TableRow>
      </TableBody>
    </TableContainer>
  );
};
